import React from 'react';
import '../../styles/components/weather/_city-list.scss';

export default function CitySelect({ cityList,  }) {
	console.log('YURRRRRR', cityList);
	return (
		<div class='city-select__wrapper'>
			<select 
				className='city-select'>
				{
					cityList.map((city) => (
						<option key={city.id}>{city.name}</option>
					))
				}
			</select>
			<span class='helper'></span>
		</div>
	)
}




